import React from 'react'
const logoProfile = new URL("../images/1.png", import.meta.url);
function About() {
  return (
    <div className="container">
      <img src={logoProfile} alt="profile image"></img>
      <h1>Muhammad Syihabuddin</h1>
    </div>
  );
}

export default About
